    //     `;
    //     });
    //     console.log("123");
    //     console.log(historyMusic);
    //     historyMusic.innerHTML = htmlsHistoryMusic.join("");
    // },

    start: function () {
      // định nghĩa thuộc tính cho object
      this.defineProperties();

      this.choseMusic();

      this.handleEvent();

      this.nextSong();

      this.prevSong();

      // this.loadCurrentSong();
    },
  };
  music.start();
  render();
