      {/* main */}
      <main className="main">
        <div className="container-fluid">
          <section className="menu">
            <div className="menu__list">
              <h3 className="menu__list-title">Menu</h3>
              <ul className="menu__list-items">
                <li className="item">
                  <div className="item__option active">
                    <i className="fa fa-home" />
